import "./Navigation.css";

const Navigation = () => {
  return (
    <nav className="navigation">
      <ul className="navigation__list">
        <li className="navigation__item"></li>
        <li className="navigation__item"></li>
        <li className="navigation__item"></li>
        <li className="navigation__item"></li>
      </ul>
    </nav>
  );
};
export default Navigation;
